import React, { useEffect, useState } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import {list} from './counterSlice'

export function Counter() {
  const count = useSelector((state) => state.counter.val)
  const dispatch = useDispatch()
  const [d, dSet] = useState();

  useEffect(() =>{
    let val = prompt('Enter data here', 'data');
    console.log(val);
    dSet(val);
  }, [d]);

  return (
    <>
    <span>{count}</span>
    <button onClick={() =>dispatch(list())}>message</button>
    {/* <button onClick={() =>dispatch(list('rrrrrrrr'))}>message</button> */}
    </>
  )
}
